const LUNR_PREVIEW_LOOKUP = {"0":{"t":"Diary and Forthcoming Task Days","p":"# Diary Dates for Working Groups in 2021 Provisional dates: September 12th -\nMeadow Raking October 10th - Scout Land. Clear vegetation, repair path,\ncoppicing and sycamore removal. November 7th - Coppicing December 12th-\nCoppicing January 9th - [To be decided](/#TODO/Tasks)  ...","l":"Calendar.md"},"1":{"t":"Contact Us","p":"## Reporting Problems in the Woods The park and woodlands are managed by Mid\nSussex District Council [http://www.midsussex.gov.uk/]. You can report any\nproblems to them on 01444 477392 or via email to\n[parksopenspaces@midsussex.gov.uk](mailto:parksopenspaces@midsussex.gov.uk ...","l":"Contact.md"},"2":{"t":"Welcome to Ashplats Conservation Group","p":"![Task Day](content/images/ashplatts-6369.jpg =400x* \"ACG Members on a Task\nDay\") Ashplats Wood is 28 ha and is part of the East Court Estate in East\nGrinstead, West Sussex, UK. The main part of the wood is designated as Ancient\nWoodland, and also a West Sussex Site of Natur ...","l":"Home.md"},"3":{"t":"Ashplats Map","p":"Map [content/images/Ashplats-Wood-Oct-2014-Map.png] Map of the Woods ...","l":"Map.md"},"4":{"t":"Things the Group Can be Doing","p":"[Website maintainence](WebSite) [Tasks in Ashplats](Tasks) ...","l":"TODO/Home.md"},"5":{"t":"Work To Be Done","p":"These are all jobs that can be done in the woods. Some are seasonal events, some\nare continuous, some will only need doing periodically. ## Control Rhododendron\nRegrowth * Get/Update Herbicide Certs. * Map locations of Rhododendron regrowth.\n* Monitor other invasive species, ...","l":"TODO/Tasks.md"},"6":{"t":"WebSite Development","p":"Things to be done in the Website ================================ * Add Meadow\nmow/rake task * Get photos and w3w grid references for the species page * Expand\nthe Species Page: newts, bats, birds, Fungi. Both Rare and Common and where to\nfind them. * Tree Survey page. * Add ...","l":"TODO/WebSite.md"},"7":{"t":"About The Woods - Wildlife Images","p":"# Images taken by the static motion sensitive camera. ### Badger Deer\n[content/images/BushCam/Badger1.jpg] A Badger grooming ### Deer Deer\n[content/images/BushCam/Deer1.png] A Deer visiting at night ### Birds Jay\n[content/images/BushCam/Jay1.png] Jay Jay [content/images/Bush ...","l":"about/bushcam.md"},"8":{"t":"Caring for the Woodland","p":"Please help us protect the woodland and wildlife by being considerate in the\nwoods. Dog walkers are always welcome. * Please keep your dogs under control and\non a lead if necessary. * It is an offence not to clean up after your dog. *\nPlease do not throw dog faeces into the  ...","l":"about/caring-for-the-woods.md"},"9":{"t":"About The Woods - Flora and Fauna","p":"Winter Tress [content/images/Winter-trees-in-Ashplats.jpg] Coppiced Sweet\nChestnut against a winter sky The woodland is typical of the High Weald\nlandscape, clothing the ridges and valley sides right down to the banks of the\ntwo streams that converge at the wood’s southern t ...","l":"about/flora-and-fauna.md"},"10":{"t":"About The Woods - Geology","p":"At its highest point, Ashplats Wood is about 130m (426ft) above sea level. The\nnorthern part of the wood is underlain by Tunbridge Wells sands and the lower\nslopes and adjoining fields are on Wadhurst clay. Wet Flush\n[content/images/P1150205.jpg] A wet “flush” half way down  ...","l":"about/geology.md"},"11":{"t":"About The Woods - History","p":"Part of the wood is ancient woodland, meaning that its been continuously wooded\nfor at least 400 years. The Tithe Map of 1841 shows the wood to be smaller than\nit is today but if you look carefully you can still see the evidence of old\nmeadow boundaries today which are now p ...","l":"about/history.md"},"12":{"t":"About The Woods - Nature Trail","p":"As a permanent reminder of the Girl-guiding Centenary celebrations (1910 -\n2010), Guides in East Grinstead, with the support of many local organizations\nincluding Ashplats Conservation Group, have installed a nature trail in the\ngardens of East Court Mansion and Ashplats Woo ...","l":"about/nature-trail.md"},"13":{"t":"About The Woods","p":"[History](history) - A brief look at the history of the woods.\n[Geology](geology) - The rocks and soils beneath your feet. [Nature\nTrail](nature-trail) - Getting around in the woods. [Flora and\nFauna](flora-and-fauna) - Things to see in the woods. [Species\nLists](/#species/H ...","l":"about/the-woods.md"},"14":{"t":"ACG Documents","p":"## Risk Assessments [Covid-19](#risk_assessments/Covid19_RA_2021.pdf) ## AGM\nMinutes To be completed ## Meeting Agendas To be completed ...","l":"documents/documents.md"},"15":{"t":"PDF Document","p":"ASHPLATS CONSERVATION GROUP COVID-19 RISK ASSESSMENT NB. This is a general risk\nassessment. Separate individual risk assessments will still be required for each\nspecific task. COVID-19 Government Guidance in relation to activities outdoors\n(as of 21st June 2021): Most restri ...","l":"documents/risk_assessments/Covid19_RA_2021.pdf"},"16":{"t":"Getting Involved","p":"A Summary of what ACG does. sasquatch.","l":"getting-involved.md"},"17":{"t":"About The Woods - Species Lists","p":"# Common Species ### Lesser Celendine lesser celendine\n[content/images/species/lesser_celendine.jpg] Lesser Celendine Flowering in\nApril with distinctive yellow flowers. This plant is often found beside paths,\nwhere it finds the dappled shade it preferrs. ### Wood Anemone wo ...","l":"species/Home.md"},"18":{"t":"Tasks","p":"Ashplats Conservation Group performs many conservation activities around the\nsite. MSDC and their contractors manage larger jobs such as felling larger trees\nand bridge construction. [Litter Picking](/pages/tasks/litter-picking) ACG\norganises an annual  litter pick around th ...","l":"tasks/Home.md"},"19":{"t":"About The Woods - Coppicing","p":"# Coppicing Most of Ashplats Wood is Ancient Woodland, which means there has\nbeen a wood on this site for more than 400 years. For centuries, up to around\n1960 woods were an important resource; trees and shrubs were regularly cut down\nand allowed to re-grow, creating a mosai ...","l":"tasks/coppicing.md"},"20":{"t":"Tasks - Litter Picking","p":"Litter [content/images/litterpick/P1030119.jpg] A large haul in 2016 Every year,\nACG organises a litter pick of the site. As many as 40 volunteers are divided\ninto teams that litter pick a section of the site. Person\n[content/images/litterpick/P1150568.jpg] Returning to base ...","l":"tasks/litter-picking.md"},"21":{"t":"Tasks - Path Building","p":"Steps [content/images/P1060208.jpg] A completed section of the steps The Ghyll\nSlope is a path up a steep wooded slope, following a fold in the hillside where\nwater naturally flows. The path had become braided as walkers sought firm\nfooting up the wet slope. Much of the path ...","l":"tasks/path-building.md"},"22":{"t":"Tasks - Pond Maintenance","p":"Pond Workers [content/images/pond_wide.jpg] A Task day in 2011 thinning willows\nin Alfreds Pond Alfreds Pond is a natural pond, water drains into it from the\nfootball pitch, and from the land above it towards the green container.\nUmaintained Pond [content/images/2003-Pond-Co ...","l":"tasks/pond-maintenance.md"},"23":{"t":"Tasks - Rhododendron Control","p":"# Controlling Invasive Species _Rhododendron Ponticum_ was introduced into\nBritain by the Victorians for its ornamental value. Unfortunately they didn’t\nrealise that it would ‘escape’ from our gardens and start to colonise our\nwoodlands. Rhododendron Ponticum [content/images ...","l":"tasks/rhododendron.md"},"24":{"t":"Tasks - The Early Years","p":"Ashplats Conservation Group was set up in 1997 with the aim of helping restore\nthe wood to its original condition. These are some of the early works carried\nout by ACG, MSDC and contractors. ## Coppicing.\n[content/images/old_times/Old_ACG_photos4-6.jpg]\n[content/images/old_t ...","l":"tasks/the-early-years.md"}};